import React from 'react';
import MyPosts from './MyPosts/MyPosts';
import s from './Profile.module.css';

const Profile = () => {
    return (
        <div>
            <div>
                <div className={s.content}>
                    <img src='https://mednavigator.ru/netcat_files/3/7/hybrid.jpg' />
                </div>
                <div>
                    ava + description
                </div>
                <div>
                    <MyPosts />
                </div>
                </div>
        </div>
    );
}

export default Profile;
